import React from 'react';
import './sub-service.css';
const SubService = () => {
  return (
    <div className='sub-service border'>
      <div className="container flex border">
        <div className='sub-service-text-top'>
        <h2>الخدمات المقدمة</h2>
          <h3>
          عالم كامل بين ايديك</h3>
        </div>

      </div>
    </div>
  );
}

export default SubService;
